USE foo;

SHOW tables;

CREATE TABLE foo.employees (
	EmpID INT(6), 
	EmpName VARCHAR(80), 
	Email VARCHAR(50), 
	PhoneNumber VARCHAR(30), 
	HireDate DATE, 
	Salary INT(8), 
	ManagerID INT(6), 
	CommissionPCT FLOAT(2), 
	RetireDate DATE, 
	DeptID INT(6), 
	JobID VARCHAR(10), 
	CreateDate DATE, 
	UpdateDate DATE
);


ALTER TABLE employees ADD PRIMARY KEY (EmpID);

